  `CRT_UID` varchar(128) DEFAULT NULL,
  `CRT_TIME` datetime DEFAULT NULL,
  `UPD_UID` varchar(128) DEFAULT NULL,
  `UPD_TIME` datetime DEFAULT NULL,
  PRIMARY KEY (`NOTICE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

